import React from 'react';
import { HashRouter as Router, Switch, Route, Redirect } from 'react-router-dom'
import './App.scss';
import {BitcoinApp} from './pages/BitcoinApp/BitcoinApp.jsx'
import {ProductPage} from './pages/ProductPage/ContactPage.jsx'
import {ContactEdit} from './pages/ContactEdit/ContactEdit.jsx'
import {ContactDetails} from './pages/ContactDetails/ContactDetails.jsx'
import { Navbar } from './cmps/Navbar/Navber.jsx'


function App() {
  return (
    <Router>
      <Navbar />
      <div className="App flex justify-center">
        <Switch>
          <Route component={ ContactEdit } path="/contact/edit/:id?" />
          <Route component={ ContactDetails } path="/contact/:id" />
          <Route component={ ContactPage } path="/contact" />
          <Route component={ BitcoinApp } exact path="/" />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
